vec4 dofTestPS(in vec2 uv, in sampler2D noise, in float focalDepth)
{
    int steps=64;
    float oosqrtsteps = 0.125/sqrt(float(steps));
    float radscale0=0.05;
    float scale=0.025;
    float ooscale = 1.0/scale;

    ivec2 tsizei = textureSize(uDepthMap,0);
    float aspect=float(tsizei.y)/float(tsizei.x);

    float tsize=float(tsizei.y);
    float ootsize = 1.0/tsize;

    float tsizex=float(tsizei.x);
    float ootsizex = 1.0/tsizex;

    vec2 fuv=vec2(floor(focalDepth)*ootsizex, 1.0-fract(focalDepth)*3000.0*ootsize);
    #ifndef PREVIEW_MAT
        float focalDepth0 = getLinearScreenDepth(fuv);
    #else
        float focalDepth0 = texture2D(uDepthMap,fuv).r*32.0;
    #endif    

    vec2 suv = gl_FragCoord.xy/256.0;

    #ifndef PREVIEW_MAT
        float d0 = getLinearScreenDepth(uv);
    #else
        float d0 = texture2D(uDepthMap,uv).r*32.0;
    #endif    
    vec4 col0 = texture2D(uColorBuffer,uv);

    float cocLen=(focalDepth0-0.1);
    float coc0 = clamp(abs(1.0-focalDepth0/d0)*scale,radscale0*oosqrtsteps,radscale0*0.5);
    coc0 = min(coc0,mix(radscale0*oosqrtsteps,radscale0*0.5,abs(d0-focalDepth0)/cocLen));

    vec4 col = vec4(0);
    float weight = 0.0;

    vec4 colF = vec4(0);
    float weightF = 0.0;

    float radscale=radscale0;

    float totArea=((radscale0*2.0)*(radscale0*2.0))/float(steps);
    float area0=(coc0)*(coc0)*3.14159;

    float maxCoc=0.0;

    for (int i=0;i<steps;i++)
    {
        vec2 rad=vec2(aspect,1.0)*radscale*2.0;

        float randA=texture2D(noise,suv.xy+vec2(float(i)/128.0,0)).r-0.5;
        float randB=texture2D(noise,suv.yx+vec2(float(i)/128.0,0)).r-0.5;

        vec2 randuv=vec2( (floor(randA*rad.x*tsizex)+0.5)*ootsizex, (floor(randB*rad.y*tsize)+0.5)*ootsize);
        //vec2 randuv=vec2( (floor(randA*rad.x*tsizex))*ootsizex, (floor(randB*rad.y*tsize))*ootsize);

   #ifndef PREVIEW_MAT
        float dA = getLinearScreenDepth(uv+randuv);
    #else
        float dA = texture2D(uDepthMap,uv+randuv).r*32.0;
    #endif
        vec4 colA = texture2D(uColorBuffer,uv+randuv);

        float radA = length(vec2(randuv.x/aspect,randuv.y));
        float cocA = clamp(abs(1.0-focalDepth0/dA)*scale, radscale0*oosqrtsteps, radscale0*0.5);        
        cocA=min(cocA,mix(radscale0*oosqrtsteps,radscale0*0.5,abs(dA-focalDepth0)/cocLen));

        float areaA=(cocA)*(cocA)*3.14159;

        if (radA<=(coc0) && dA>=d0)
        {
            col += colA * totArea/(area0); 
            weight += totArea/(area0);

            maxCoc=max(maxCoc,coc0);
        }    
        else if (radA<=(cocA) && dA<d0)
        {
            colF += colA * totArea/(areaA); 
            weightF += totArea/(areaA);

            maxCoc=max(maxCoc,cocA);
        }

        radscale=radscale0;
    }

    float minW = totArea/((radscale0*oosqrtsteps)*(radscale0*oosqrtsteps)*3.14159);

    if (weight<=0.0)
    {
        col = col0*(minW);
        weight += (minW);
        if (weightF>0.0)
        {
            colF += colF*(1.0/weightF)*(minW);
            weightF += minW;
        }
    }

    col=mix(vec4(0), col*(1.0/weight), float(weight>0.0));
    colF=mix(vec4(0), colF*(1.0/weightF), float(weightF>0.0));

    float alpha = weightF/(weight+weightF);
    return vec4(mix(col.rgb,colF.rgb,alpha),maxCoc/(radscale0*0.5));
}

